CREATE DATABASE IF NOT EXISTS qflexesb;

GRANT ALL PRIVILEGES ON qflexesb.* TO 'qflex'@'localhost' IDENTIFIED BY 'netflexity' WITH GRANT OPTION;
GRANT ALL PRIVILEGES ON qflexesb.* TO 'qflex'@'%' IDENTIFIED BY 'netflexity' WITH GRANT OPTION;
USE qflexesb;
DROP TABLE IF EXISTS qflexesb.alert_status_types;
CREATE TABLE qflexesb.alert_status_types (  alert_status_type_id bigint(20) NOT NULL default '0',  display_seq_no int(11) NOT NULL default '0',  description varchar(64) NOT NULL default '',  PRIMARY KEY  (alert_status_type_id)) ENGINE=InnoDB DEFAULT CHARSET=utf8;
DROP TABLE IF EXISTS qflexesb.alert_types;
CREATE TABLE alert_types (  alert_type_id bigint(20) NOT NULL default '0',  display_seq_no int(11) NOT NULL default '0',  description varchar(64) NOT NULL default '',  PRIMARY KEY  (alert_type_id)) ENGINE=InnoDB DEFAULT CHARSET=utf8;
DROP TABLE IF EXISTS qflexesb.alerts;
CREATE TABLE alerts (  alert_id bigint(20) NOT NULL default '0',  parent_id bigint(20) default NULL,  monitor_id bigint(20) NOT NULL default '0',  alert_status_type_id bigint(20) NOT NULL default '0',  criticality_type_id bigint(20) NOT NULL default '0',  alert_nm varchar(255) NOT NULL default '',  occurrence_start_tm bigint(20) NOT NULL default '0',  occurrence_end_tm bigint(20) default NULL,  alert_text text,  comments varchar(255) default NULL,  modified_tm bigint(20) default NULL,  modified_by varchar(32) default NULL,  PRIMARY KEY  (alert_id)) ENGINE=InnoDB DEFAULT CHARSET=utf8;
DROP TABLE IF EXISTS qflexesb.applications;
CREATE TABLE applications (application_id bigint(20) NOT NULL default '0',company_id bigint(20) NOT NULL default '0',application_type varchar(64) NOT NULL default '',application_nm varchar(64) NOT NULL default '',description varchar(255) default '',modified_tm bigint(20) default NULL,modified_by varchar(32) default '',PRIMARY KEY  (application_id)) ENGINE=InnoDB DEFAULT CHARSET=utf8;
DROP TABLE IF EXISTS qflexesb.application_destinations;
CREATE TABLE application_destinations (application_destination_id bigint(20) NOT NULL default '0',application_id bigint(20) NOT NULL default '0',destination_id bigint(20) NOT NULL default '0',destination_type_id int(11) NOT NULL default '0',destination_purpose_type_id int(11) NOT NULL default '0',destination_nm varchar(48) default '',modified_tm bigint(20) default NULL,modified_by varchar(32) default '',PRIMARY KEY  (application_destination_id)) ENGINE=InnoDB DEFAULT CHARSET=utf8;
DROP TABLE IF EXISTS qflexesb.channels;
CREATE TABLE channels (  channel_id bigint(20) NOT NULL default '0',  qmanager_id bigint(20) NOT NULL default '0',  channel_nm varchar(48) NOT NULL default '',  channel_tp int(11) NOT NULL default '0',  status int(11) NOT NULL default '0',  modified_tm bigint(20) default NULL,  modified_by varchar(32) default NULL,  PRIMARY KEY  (channel_id)) ENGINE=InnoDB DEFAULT CHARSET=utf8;
DROP TABLE IF EXISTS qflexesb.collection_policies;
CREATE TABLE collection_policies (  collection_policy_id bigint(20) NOT NULL default '0',  qmanager_id bigint(20) NOT NULL default '0',  interval_type_id bigint(20) NOT NULL default '0',  interval_val bigint(20) NOT NULL default '0',  status int(11) NOT NULL default '0',  filter varchar(255) default NULL,  modified_tm bigint(20) default NULL,  modified_by varchar(32) default NULL,  PRIMARY KEY  (collection_policy_id)) ENGINE=InnoDB DEFAULT CHARSET=utf8;
DROP TABLE IF EXISTS qflexesb.companies;
CREATE TABLE companies (  company_id bigint(20) NOT NULL default '0',  company_nm varchar(128) NOT NULL default '',  serial_no varchar(96) NOT NULL default '',  addr varchar(255) default NULL,  city varchar(64) default NULL,  state varchar(2) default NULL,  zip varchar(11) default NULL,  email varchar(255) NOT NULL default '',  phone varchar(15) default NULL,  modified_tm bigint(20) default NULL,  modified_by varchar(32) default NULL,  PRIMARY KEY  (company_id)) ENGINE=InnoDB DEFAULT CHARSET=utf8;
DROP TABLE IF EXISTS qflexesb.compression_policies;
CREATE TABLE compression_policies (  compression_policy_id bigint(20) NOT NULL default '0',  qmanager_id bigint(20) NOT NULL default '0',  interval_type_id bigint(20) NOT NULL default '0',  frequency_type_id bigint(20) NOT NULL default '0',  interval_val bigint(20) NOT NULL default '0',  time_of_compression bigint(20) default '0',  status int(11) NOT NULL default '0',  modified_tm bigint(20) default NULL,  modified_by varchar(32) default NULL,  PRIMARY KEY  (compression_policy_id)) ENGINE=InnoDB DEFAULT CHARSET=utf8;
DROP TABLE IF EXISTS qflexesb.criticality_types;
CREATE TABLE criticality_types (  criticality_type_id bigint(20) NOT NULL default '0',  display_seq_no int(11) NOT NULL default '0',  description varchar(64) NOT NULL default '',  PRIMARY KEY  (criticality_type_id)) ENGINE=InnoDB DEFAULT CHARSET=utf8;
DROP TABLE IF EXISTS qflexesb.frequency_types;
CREATE TABLE frequency_types (  frequency_type_id bigint(20) NOT NULL default '0',  min_interval_type_id bigint(20) NOT NULL default '0',  millis bigint(20) NOT NULL default '0',  display_seq_no int(11) NOT NULL default '0',  description varchar(64) NOT NULL default '',  PRIMARY KEY  (frequency_type_id)) ENGINE=InnoDB DEFAULT CHARSET=utf8;
DROP TABLE IF EXISTS qflexesb.idle_reason_types;
CREATE TABLE idle_reason_types (  idle_reason_type_id bigint(20) NOT NULL default '0',  display_seq_no int(11) NOT NULL default '0',  description varchar(64) NOT NULL default '',  PRIMARY KEY  (idle_reason_type_id)) ENGINE=InnoDB DEFAULT CHARSET=utf8;
DROP TABLE IF EXISTS qflexesb.interval_types;
CREATE TABLE interval_types (  interval_type_id bigint(20) NOT NULL default '0',  millis bigint(20) NOT NULL default '0',  display_seq_no int(11) NOT NULL default '0',  description varchar(64) NOT NULL default '',  PRIMARY KEY  (interval_type_id)) ENGINE=InnoDB DEFAULT CHARSET=utf8;
DROP TABLE IF EXISTS qflexesb.message_purger_policies;
CREATE TABLE message_purger_policies (  message_purger_policy_id bigint(20) NOT NULL default '0',  queue_id bigint(20) NOT NULL default '0',  interval_type_id bigint(20) NOT NULL default '0',  interval_val bigint(20) NOT NULL default '0',  purger_interval_type_id bigint(20) NOT NULL default '0',  purger_interval_val bigint(20) NOT NULL default '0',  status int(11) NOT NULL default '0',  PRIMARY KEY  (message_purger_policy_id)) ENGINE=InnoDB DEFAULT CHARSET=utf8;
DROP TABLE IF EXISTS qflexesb.message_types;
CREATE TABLE message_types (  message_type_id bigint(20) NOT NULL default '0',  trig_condition_type_id bigint(20) NOT NULL default '0',  display_seq_no int(11) NOT NULL default '0',  description text NOT NULL,  PRIMARY KEY  (message_type_id)) ENGINE=InnoDB DEFAULT CHARSET=utf8;
DROP TABLE IF EXISTS qflexesb.monitor_templates;
CREATE TABLE monitor_templates (  monitor_template_id bigint(20) NOT NULL default '0',  company_id bigint(20) NOT NULL default '0',  monitor_type_id bigint(20) NOT NULL default '0',  trig_condition_type_id bigint(20) NOT NULL default '0',  criticality_type_id bigint(20) NOT NULL default '0',  template_nm varchar(255) NOT NULL default '',  occurrence_interval int(11) NOT NULL default '0',  polling_interval bigint(20) NOT NULL default '0',  modified_tm bigint(20) default NULL,  modified_by varchar(32) default NULL,  PRIMARY KEY  (monitor_template_id)) ENGINE=InnoDB DEFAULT CHARSET=utf8;
DROP TABLE IF EXISTS qflexesb.monitor_types;
CREATE TABLE monitor_types (  monitor_type_id bigint(20) NOT NULL default '0',  display_seq_no int(11) NOT NULL default '0',  description varchar(64) NOT NULL default '',  PRIMARY KEY  (monitor_type_id)) ENGINE=InnoDB DEFAULT CHARSET=utf8;
DROP TABLE IF EXISTS qflexesb.monitors;
CREATE TABLE monitors (  monitor_id bigint(20) NOT NULL default '0',  company_id bigint(20) NOT NULL default '0',  qmanager_id bigint(20) NOT NULL default '0',  monitor_object_id bigint(20) NOT NULL default '0',  monitor_type_id bigint(20) NOT NULL default '0',  trig_condition_type_id bigint(20) NOT NULL default '0',  trig_condition_param bigint(20) default NULL,  criticality_type_id bigint(20) NOT NULL default '0',  monitor_nm varchar(255) NOT NULL default '',  message_text text NOT NULL,  recovery_text text NOT NULL,  occurrence_interval int(11) NOT NULL default '0',  polling_interval bigint(20) NOT NULL default '0',  log_file varchar(255) default NULL,  status int(11) NOT NULL default '0',  email_list varchar(255) default NULL,  modified_tm bigint(20) default NULL,  modified_by varchar(32) default NULL,  PRIMARY KEY  (monitor_id)) ENGINE=InnoDB DEFAULT CHARSET=utf8;
DROP TABLE IF EXISTS qflexesb.monitors_alert_types;
CREATE TABLE monitors_alert_types (  monitors_alert_types_id bigint(20) NOT NULL default '0',  monitor_id bigint(20) default '0',  monitor_template_id bigint(20) default '0',  alert_type_id bigint(20) NOT NULL default '0',  modified_tm bigint(20) default NULL,  modified_by varchar(32) default NULL,  PRIMARY KEY  (monitors_alert_types_id)) ENGINE=InnoDB DEFAULT CHARSET=utf8;
DROP TABLE IF EXISTS qflexesb.monitors_polling_policies;
CREATE TABLE monitors_polling_policies (  monitors_polling_policies_id bigint(20) NOT NULL default '0',  monitor_id bigint(20) default '0',  polling_policy_id bigint(20) NOT NULL default '0',  monitor_template_id bigint(20) default '0',  modified_tm bigint(20) default NULL,  modified_by varchar(32) default NULL,  PRIMARY KEY  (monitors_polling_policies_id)) ENGINE=InnoDB DEFAULT CHARSET=utf8;
DROP TABLE IF EXISTS qflexesb.monitors_recovery_actions;
CREATE TABLE monitors_recovery_actions (  monitors_recovery_action_id bigint(20) NOT NULL default '0',  monitor_id bigint(20) default '0',  monitor_template_id bigint(20) default '0',  recovery_action_id bigint(20) NOT NULL default '0',  modified_tm bigint(20) default NULL,  modified_by varchar(32) default NULL,  PRIMARY KEY  (monitors_recovery_action_id)) ENGINE=InnoDB DEFAULT CHARSET=utf8;
DROP TABLE IF EXISTS qflexesb.polling_policies;
CREATE TABLE polling_policies (  polling_policy_id bigint(20) NOT NULL default '0',  polling_policy_nm varchar(48) NOT NULL default '',  company_id bigint(20) NOT NULL default '0',  minutes varchar(196) NOT NULL default '',  hours varchar(196) NOT NULL default '',  days_of_week varchar(16) NOT NULL default '',  days_of_month varchar(96) NOT NULL default '',  months varchar(32) NOT NULL default '',  seconds varchar(196) NOT NULL default '',  modified_tm bigint(20) default NULL,  modified_by varchar(32) default NULL,  PRIMARY KEY  (polling_policy_id)) ENGINE=InnoDB DEFAULT CHARSET=utf8;
DROP TABLE IF EXISTS qflexesb.principals;
CREATE TABLE principals (  principal_id bigint(20) NOT NULL default '0',  company_id bigint(20) NOT NULL default '0',  principal_nm varchar(128) NOT NULL default '',  username varchar(16) NOT NULL default '',  password varchar(96) NOT NULL default '',  role varchar(10) NOT NULL default '',  email varchar(255) NOT NULL default '',  phone varchar(15) default NULL,  modified_tm bigint(20) default NULL,  modified_by varchar(32) default NULL,  PRIMARY KEY  (principal_id)) ENGINE=InnoDB DEFAULT CHARSET=utf8;
DROP TABLE IF EXISTS qflexesb.qflex_properties;
CREATE TABLE qflex_properties (  qflex_property_id bigint(20) NOT NULL default '0',  company_id bigint(20) NOT NULL default '0',  property_type tinyint(4) NOT NULL default '0',  property_nm varchar(255) NOT NULL default '',  property_val varchar(255) default '',  modified_tm bigint(20) default NULL,  modified_by varchar(32) default NULL,  PRIMARY KEY  (qflex_property_id)) ENGINE=InnoDB DEFAULT CHARSET=utf8;
DROP TABLE IF EXISTS qflexesb.qmanagers;
CREATE TABLE qmanagers (  qmanager_id bigint(20) NOT NULL default '0',  company_id bigint(20) NOT NULL default '0',  status int(11) NOT NULL default '0',  qmanager_nm varchar(48) NOT NULL default '',  qmanager_alias varchar(96) default '',  host_nm varchar(255) NOT NULL default '',  host_data_root varchar(255) default NULL,  host_user varchar(32) default NULL,  host_pwd varchar(32) default NULL,  channel_nm varchar(20) NOT NULL default '',  port int(4) NOT NULL default '0',  command_server_qname varchar(255) default NULL,  command_server_reply_queue varchar(255) default NULL,  os varchar(255) default NULL,  os_version varchar(64) default NULL,  mq_version varchar(64) default NULL,  ssl_keystore varchar(255) default NULL,ssl_keystore_pwd varchar(32) default NULL,ssl_truststore varchar(255) default NULL,ssl_truststore_pwd varchar(32) default NULL,ssl_cipher_spec varchar(48) default NULL,ssl_peer_nm varchar(64) default NULL, modified_tm bigint(20) default NULL,  modified_by varchar(32) default NULL,  PRIMARY KEY  (qmanager_id)) ENGINE=InnoDB DEFAULT CHARSET=utf8;
DROP TABLE IF EXISTS qflexesb.queue_stats;
CREATE TABLE queue_stats (  queue_stat_id bigint(20) NOT NULL default '0',  queue_id bigint(20) NOT NULL default '0',  msg_in int(11) NOT NULL default '0',  msg_out int(11) NOT NULL default '0',  high_depth int(11) NOT NULL default '0',  fetch_start_tm bigint(20) NOT NULL default '0',  fetch_end_tm bigint(20) NOT NULL default '0',  time_since_reset bigint(20) NOT NULL default '0',  modified_tm bigint(20) default NULL,  modified_by varchar(32) default NULL,  PRIMARY KEY  (queue_stat_id),  KEY TIME (fetch_start_tm,fetch_end_tm)) ENGINE=InnoDB DEFAULT CHARSET=utf8;
DROP TABLE IF EXISTS qflexesb.queue_stats_idleness;
CREATE TABLE queue_stats_idleness (  queue_stats_idleness_id bigint(20) NOT NULL default '0',  qmanager_id bigint(20) NOT NULL default '0',  idle_start_tm bigint(20) NOT NULL default '0',  idle_end_tm bigint(20) NOT NULL default '0',  idle_reason_type_id bigint(20) NOT NULL default '0',  status int(11) NOT NULL default '0',  modified_tm bigint(20) default NULL,  modified_by varchar(32) default NULL,  PRIMARY KEY  (queue_stats_idleness_id)) ENGINE=InnoDB DEFAULT CHARSET=utf8;
DROP TABLE IF EXISTS qflexesb.queues;
CREATE TABLE queues (  queue_id bigint(20) NOT NULL default '0',  qmanager_id bigint(20) NOT NULL default '0',  queue_nm varchar(48) NOT NULL default '',  queue_tp int(11) NOT NULL default '0',  status int(11) NOT NULL default '0',  modified_tm bigint(20) default NULL,  modified_by varchar(32) default NULL,  PRIMARY KEY  (queue_id)) ENGINE=InnoDB DEFAULT CHARSET=utf8;
DROP TABLE IF EXISTS qflexesb.recovery_actions;
CREATE TABLE recovery_actions (  recovery_action_id bigint(20) NOT NULL default '0',  recovery_action_type_id bigint(20) NOT NULL default '0',  company_id bigint(20) NOT NULL default '0',  action_nm varchar(128) NOT NULL default '',  java_class varchar(255) default NULL,  command varchar(255) default NULL,  command_args varchar(255) default NULL,  modified_tm bigint(20) default NULL,  modified_by varchar(32) default NULL,  PRIMARY KEY  (recovery_action_id)) ENGINE=InnoDB DEFAULT CHARSET=utf8;
DROP TABLE IF EXISTS qflexesb.recovery_types;
CREATE TABLE recovery_types (  recovery_type_id bigint(20) NOT NULL default '0',  trig_condition_type_id bigint(20) NOT NULL default '0',  display_seq_no int(11) NOT NULL default '0',  description text NOT NULL,  PRIMARY KEY  (recovery_type_id)) ENGINE=InnoDB DEFAULT CHARSET=utf8;
DROP TABLE IF EXISTS qflexesb.reports;
CREATE TABLE reports (  report_id bigint(20) NOT NULL default '0',  report_type_id bigint(20) NOT NULL default '0',  name varchar(255) NOT NULL default '',  action varchar(128) NOT NULL default '',  query_string varchar(255) NOT NULL default '',  comments varchar(255) default NULL,  modified_tm bigint(20) default NULL,  modified_by varchar(32) default NULL,  PRIMARY KEY  (report_id)) ENGINE=InnoDB DEFAULT CHARSET=utf8;
DROP TABLE IF EXISTS qflexesb.trig_condition_types;
CREATE TABLE trig_condition_types (  trig_condition_type_id bigint(20) NOT NULL default '0',  monitor_type_id bigint(20) NOT NULL default '0',  trig_condition_type_nm varchar(128) NOT NULL default '',  requires_param char(1) NOT NULL default '',  display_seq_no int(11) NOT NULL default '0',  description varchar(64) NOT NULL default '',  PRIMARY KEY  (trig_condition_type_id)) ENGINE=InnoDB DEFAULT CHARSET=utf8;
DROP TABLE IF EXISTS qflexesb.wmbi_acls;
CREATE TABLE wmbi_acls (  wmbi_acl_id bigint(20) NOT NULL default '0',  wmbi_broker_id bigint(20) NOT NULL default '0',  wmbi_topic_id bigint(20) NOT NULL default '0',  wmbi_user_id bigint(20) NOT NULL default '0',  publish_ind int(11) default '0',  subscribe_ind int(11) default '0',  persistent_ind int(11) default '0',  modified_tm bigint(20) default NULL,  modified_by varchar(32) default NULL,  PRIMARY KEY  (wmbi_acl_id)) ENGINE=InnoDB DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC;
DROP TABLE IF EXISTS qflexesb.wmbi_brokers;
CREATE TABLE wmbi_brokers (  wmbi_broker_id bigint(20) NOT NULL default '0',  queue_id bigint(20) NOT NULL default '0',  uuid varchar(128) NOT NULL default '',  broker_nm varchar(48) NOT NULL default '',  broker_alias varchar(48) NOT NULL default '',  broker_version varchar(8) default NULL,  status int(11) NOT NULL default '0',  modified_tm bigint(20) default NULL,  modified_by varchar(32) default NULL,  PRIMARY KEY  (wmbi_broker_id)) ENGINE=InnoDB DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC;
DROP TABLE IF EXISTS qflexesb.wmbi_compression_policies;
CREATE TABLE wmbi_compression_policies (  wmbi_compression_policy_id bigint(20) NOT NULL default '0',  wmbi_broker_id bigint(20) NOT NULL default '0',  interval_type_id bigint(20) NOT NULL default '0',  frequency_type_id bigint(20) NOT NULL default '0',  interval_val bigint(20) NOT NULL default '0',  time_of_compression bigint(20) default '0',  status int(11) NOT NULL default '0',  modified_tm bigint(20) default NULL,  modified_by varchar(32) default NULL,  PRIMARY KEY  (wmbi_compression_policy_id),  KEY wmbi_compol_bridindx TYPE BTREE (wmbi_broker_id)) ENGINE=InnoDB DEFAULT CHARSET=utf8;
DROP TABLE IF EXISTS qflexesb.wmbi_exec_groups;
CREATE TABLE wmbi_exec_groups (  wmbi_exec_group_id bigint(20) NOT NULL default '0',  wmbi_broker_id bigint(20) NOT NULL default '0',  uuid varchar(128) NOT NULL default '',  exec_group_nm varchar(128) NOT NULL default '0',  status int(11) NOT NULL default '0',  modified_tm bigint(20) default NULL,  modified_by varchar(32) default NULL,  PRIMARY KEY  (wmbi_exec_group_id)) ENGINE=InnoDB DEFAULT CHARSET=utf8;
DROP TABLE IF EXISTS qflexesb.wmbi_flow_stats;
CREATE TABLE wmbi_flow_stats (  wmbi_flow_stat_id bigint(20) NOT NULL default '0',  wmbi_flow_id bigint(20) NOT NULL default '0',  wmbi_snapshot_id bigint(20) NOT NULL default '0',  max_elapsed_tm bigint(20) NOT NULL default '0',  min_elapsed_tm bigint(20) NOT NULL default '0',  max_cpu_tm bigint(20) NOT NULL default '0',  min_cpu_tm bigint(20) NOT NULL default '0',  pool_threads bigint(20) NOT NULL default '0',  max_threads bigint(20) NOT NULL default '0',  mq_errs bigint(20) NOT NULL default '0',  msgs_w_errs bigint(20) NOT NULL default '0',  errs_process_msgs bigint(20) NOT NULL default '0',  aggreg_msg_timeouts bigint(20) NOT NULL default '0',  commits bigint(20) NOT NULL default '0',  backouts bigint(20) NOT NULL default '0',  account_origin varchar(48) NOT NULL default '',  modified_tm bigint(20) default NULL,  modified_by varchar(32) default NULL,  PRIMARY KEY  (wmbi_flow_stat_id)) ENGINE=InnoDB DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC;
DROP TABLE IF EXISTS qflexesb.wmbi_flows;
CREATE TABLE wmbi_flows (  wmbi_flow_id bigint(20) NOT NULL default '0',  wmbi_exec_group_id bigint(20) NOT NULL default '0',  flow_nm varchar(128) NOT NULL default '',  uuid varchar(48) default NULL,  additional_instances int(11) default '0',  commit_count int(11) default '0',  commit_interval int(11) default '0',  coord_transaction_ind int(11) default '0',  status int(11) NOT NULL default '0',  modified_tm bigint(20) default NULL,  modified_by varchar(32) default NULL,  PRIMARY KEY  (wmbi_flow_id)) ENGINE=InnoDB DEFAULT CHARSET=utf8;
DROP TABLE IF EXISTS qflexesb.wmbi_neighbors;
CREATE TABLE wmbi_neighbors (  wmbi_neighbor_id bigint(20) NOT NULL default '0',  wmbi_broker_id bigint(20) NOT NULL default '0',  uuid varchar(128) NOT NULL default '',  neighbor_nm varchar(128) NOT NULL default '',  modified_tm bigint(20) default NULL,  modified_by varchar(32) default NULL,  PRIMARY KEY  (wmbi_neighbor_id)) ENGINE=InnoDB DEFAULT CHARSET=utf8;
DROP TABLE IF EXISTS qflexesb.wmbi_node_stats;
CREATE TABLE wmbi_node_stats (  wmbi_node_stat_id bigint(20) NOT NULL default '0',  wmbi_node_id bigint(20) NOT NULL default '0',  wmbi_snapshot_id bigint(20) NOT NULL default '0',  elapsed_tm bigint(20) NOT NULL default '0',  max_elapsed_tm bigint(20) NOT NULL default '0',  min_elapsed_tm bigint(20) NOT NULL default '0',  cpu_tm bigint(20) NOT NULL default '0',  max_cpu_tm bigint(20) NOT NULL default '0',  min_cpu_tm bigint(20) NOT NULL default '0',  in_terminals bigint(20) NOT NULL default '0',  out_terminals bigint(20) NOT NULL default '0',  invocations bigint(20) NOT NULL default '0',  modified_tm bigint(20) default NULL,  modified_by varchar(32) default NULL,  PRIMARY KEY  (wmbi_node_stat_id)) ENGINE=InnoDB DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC;
DROP TABLE IF EXISTS qflexesb.wmbi_nodes;
CREATE TABLE wmbi_nodes (  wmbi_node_id bigint(20) NOT NULL default '0',  wmbi_flow_id bigint(20) NOT NULL default '0',  uuid varchar(128) default '',  node_nm varchar(128) NOT NULL default '0',  node_tp varchar(128) NOT NULL default '',  status int(11) NOT NULL default '0',  modified_tm bigint(20) default NULL,  modified_by varchar(32) default NULL,  PRIMARY KEY  (wmbi_node_id)) ENGINE=InnoDB DEFAULT CHARSET=utf8;
DROP TABLE IF EXISTS qflexesb.wmbi_snapshots;
CREATE TABLE wmbi_snapshots (  wmbi_snapshot_id bigint(20) NOT NULL default '0',  start_tm bigint(20) NOT NULL default '0',  end_tm bigint(20) NOT NULL default '0',  modified_tm bigint(20) default NULL,  modified_by varchar(32) default NULL,  wmbi_broker_id bigint(20) NOT NULL default '0',  PRIMARY KEY  (wmbi_snapshot_id)) ENGINE=InnoDB DEFAULT CHARSET=utf8;
DROP TABLE IF EXISTS qflexesb.wmbi_stats_subscriptions;
CREATE TABLE wmbi_stats_subscriptions (  wmbi_stats_subscription_id bigint(20) NOT NULL default '0',  wmbi_broker_id bigint(20) NOT NULL default '0',  subscription_object_id bigint(20) NOT NULL default '0',  subscription_object_tp int(11) NOT NULL default '0',  status int(11) NOT NULL default '0',  node_level char(1) NOT NULL default '',  thread_level char(1) NOT NULL default '',  modified_tm bigint(20) default NULL,  modified_by varchar(32) default NULL,  PRIMARY KEY  (wmbi_stats_subscription_id)) ENGINE=InnoDB DEFAULT CHARSET=utf8;
DROP TABLE IF EXISTS qflexesb.wmbi_subscriptions;
CREATE TABLE wmbi_subscriptions (  wmbi_subscription_id bigint(20) NOT NULL default '0',  wmbi_broker_id bigint(20) NOT NULL default '0',  wmbi_user_id bigint(20) NOT NULL default '0',  wmbi_topic_id bigint(20) NOT NULL default '0',  client_id varchar(255) NOT NULL default '',  subscription_point varchar(255) default '',  filter text,  persistent_ind int(11) default '0',  local_only_ind int(11) default '0',  pub_on_req_only_ind int(11) default '0',  inform_id_ret_ind int(11) default '0',  expiry_tm bigint(20) default '0',  create_tm bigint(20) default '0',  temp_dyno_queue int(11) default '0',  client_context text,  modified_tm bigint(20) default NULL,  modified_by varchar(32) default NULL,  PRIMARY KEY  (wmbi_subscription_id)) ENGINE=InnoDB DEFAULT CHARSET=utf8;
DROP TABLE IF EXISTS qflexesb.wmbi_terminal_stats;
CREATE TABLE wmbi_terminal_stats (  wmbi_terminal_stat_id bigint(20) NOT NULL default '0',  wmbi_terminal_id bigint(20) NOT NULL default '0',  wmbi_snapshot_id bigint(20) NOT NULL default '0',  invocations bigint(20) NOT NULL default '0',  modified_tm bigint(20) default NULL,  modified_by varchar(32) default NULL,  PRIMARY KEY  (wmbi_terminal_stat_id)) ENGINE=InnoDB DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC;
DROP TABLE IF EXISTS qflexesb.wmbi_terminals;
CREATE TABLE wmbi_terminals (  wmbi_terminal_id bigint(20) NOT NULL default '0',  wmbi_node_id bigint(20) NOT NULL default '0',  terminal_nm varchar(128) NOT NULL default '',  terminal_tp varchar(8) NOT NULL default '',  modified_tm bigint(20) default NULL,  modified_by varchar(32) default NULL,  PRIMARY KEY  (wmbi_terminal_id)) ENGINE=InnoDB DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC;
DROP TABLE IF EXISTS qflexesb.wmbi_thread_stats;
CREATE TABLE wmbi_thread_stats (  wmbi_thread_stat_id bigint(20) NOT NULL default '0',  wmbi_flow_id bigint(20) NOT NULL default '0',  wmbi_snapshot_id bigint(20) NOT NULL default '0',  seq_no bigint(20) NOT NULL default '0',  in_msgs bigint(20) NOT NULL default '0',  elapsed_tm bigint(20) NOT NULL default '0',  cpu_tm bigint(20) NOT NULL default '0',  cpu_tm_wait_in_msg bigint(20) NOT NULL default '0',  elapsed_tm_wait_in_msg bigint(20) NOT NULL default '0',  in_msgs_size bigint(20) NOT NULL default '0',  max_in_msgs_size bigint(20) NOT NULL default '0',  min_in_msgs_size bigint(20) NOT NULL default '0',  modified_tm bigint(20) default NULL,  modified_by varchar(32) default NULL,  PRIMARY KEY  (wmbi_thread_stat_id)) ENGINE=InnoDB DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC;
DROP TABLE IF EXISTS qflexesb.wmbi_user_types;
CREATE TABLE wmbi_user_types (  wmbi_user_type_id bigint(20) NOT NULL default '0',  user_type_nm varchar(48) NOT NULL default '',  PRIMARY KEY  (wmbi_user_type_id)) ENGINE=InnoDB DEFAULT CHARSET=utf8;
DROP TABLE IF EXISTS qflexesb.wmbi_users;
CREATE TABLE wmbi_users (  wmbi_user_id bigint(20) NOT NULL default '0',  wmbi_user_type_id bigint(20) NOT NULL default '0',  username varchar(64) NOT NULL default '',  modified_tm bigint(20) default NULL,  modified_by varchar(32) default NULL,  PRIMARY KEY  (wmbi_user_id)) ENGINE=InnoDB DEFAULT CHARSET=utf8;
DROP TABLE IF EXISTS qflexesb.config_attribute_types;
CREATE TABLE config_attribute_types (  config_attribute_type_id bigint(20) NOT NULL default '0',  config_object_type_id bigint(20) NOT NULL default '0',  display_seq_no int(11) NOT NULL default '0',  description varchar(64) NOT NULL default '',  mq_attribute_id int(11) NOT NULL default '0',  data_type int(11) NOT NULL default '0',  immutable char(1) NOT NULL default '',  required_for_change char(1) NOT NULL default '',  PRIMARY KEY  (config_attribute_type_id)) ENGINE=InnoDB DEFAULT CHARSET=utf8;
DROP TABLE IF EXISTS qflexesb.config_attributes;
CREATE TABLE config_attributes (  config_attribute_id bigint(20) NOT NULL default '0',  config_object_change_id bigint(20) NOT NULL default '0',  config_attribute_type_id bigint(20) NOT NULL default '0',  attribute_val varchar(128) default NULL,  modified_tm bigint(20) default NULL,  modified_by varchar(32) default NULL,  PRIMARY KEY  (config_attribute_id)) ENGINE=InnoDB DEFAULT CHARSET=utf8;
DROP TABLE IF EXISTS qflexesb.config_collection_policies;
CREATE TABLE config_collection_policies (  config_collection_policy_id bigint(20) NOT NULL default '0',  qmanager_id bigint(20) NOT NULL default '0',  interval_type_id bigint(20) NOT NULL default '0',  interval_val bigint(20) NOT NULL default '0',  status int(11) NOT NULL default '0',  queue_filter varchar(255) default NULL,  channel_filter varchar(255) default NULL,  modified_tm bigint(20) default NULL,  modified_by varchar(32) default NULL,  PRIMARY KEY  (config_collection_policy_id)) ENGINE=InnoDB DEFAULT CHARSET=utf8;
DROP TABLE IF EXISTS qflexesb.config_deploy_policies;
CREATE TABLE config_deploy_policies (  config_deploy_policy_id bigint(20) NOT NULL default '0',  config_object_change_id bigint(20) NOT NULL default '0',  target_qmanager_id bigint(20) NOT NULL default '0',  status int(11) NOT NULL default '0',  deploy_tm bigint(20) NOT NULL default '0',  modified_tm bigint(20) default NULL,  modified_by varchar(32) default NULL,  PRIMARY KEY  (config_deploy_policy_id)) ENGINE=InnoDB DEFAULT CHARSET=utf8;
DROP TABLE IF EXISTS qflexesb.config_object_changes;
CREATE TABLE config_object_changes (  config_object_change_id bigint(20) NOT NULL default '0',  config_object_type_id bigint(20) NOT NULL default '0',  config_object_id bigint(20) NOT NULL default '0',  release_num int(11) NOT NULL default '0',  revision_num int(11) NOT NULL default '0',  changed_tm bigint(20) NOT NULL default '0',  status int(11) NOT NULL default '0',  change_nm varchar(64) NOT NULL default '',  sub_revision_num int(11) NOT NULL default '0',  modified_tm bigint(20) default NULL,  modified_by varchar(32) default NULL,  PRIMARY KEY  (config_object_change_id)) ENGINE=InnoDB DEFAULT CHARSET=utf8;
DELETE FROM qflexesb.config_attribute_types;
create index qs_sttmindx using btree on queue_stats(fetch_start_tm);
create index qs_ettmindx using btree on queue_stats(fetch_end_tm);
