create index colpol_qmidindx using btree on collection_policies(qmanager_id);
create index compol_qmidindx using btree on compression_policies(qmanager_id);
create index mon_qmindx using btree on monitors(qmanager_id);
create index mon_objidindx using btree on monitors(monitor_object_id);
